  *{ box-sizing:border-box; }

  .muted{ color:var(--sub); font-size:12px; }
  .tools{ display:flex; gap:8px; align-items:center; }
  .btn{ border:1px solid var(--border); background:var(--chip); color:var(--text); padding:8px 10px; border-radius:10px; cursor:pointer; font-weight:700; }
  .container{ display:grid; grid-template-columns: 1.2fr 2fr; gap:20px; padding:20px; }
  .card{ background:var(--card); border:1px solid var(--border); border-radius:16px; padding:16px; }
  h2{ margin:0 0 10px 0; font-size:16px; color:var(--sub); font-weight:700; letter-spacing:.3px; position:relative; z-index:0; }
  .positions{ display:flex; flex-wrap:wrap; gap:8px; }
  .chip{ background:var(--chip); padding:8px 10px; border-radius:10px; font-weight:700; display:inline-flex; align-items:center; gap:8px; border:1px solid var(--border); }
  .chip small{ color:var(--sub); font-weight:700; letter-spacing:.2px; opacity:.9; }
  .grid{ display:grid; grid-template-columns: repeat(auto-fit, minmax(240px,1fr)); gap:14px; }
  .group{ background:var(--card); border:1px solid var(--border); border-radius:14px; overflow:hidden; display:flex; flex-direction:column; position:relative; z-index:1; }
  .group header{ display:flex; justify-content:space-between; align-items:center; padding:10px 12px; border-bottom:1px solid var(--border); position:relative; z-index:1; scroll-margin-top: calc(var(--header-h) + 12px); }
  .group header h3{ margin:0; font-size:15px; font-weight:800; color:var(--text); letter-spacing:.2px; position:relative; z-index:1; }
  .opts{ display:flex; flex-wrap:wrap; gap:8px; padding:12px; }
  button.opt{ border:1px solid var(--border); background:var(--chip); color:var(--text); padding:8px 10px; border-radius:10px; cursor:pointer; font-weight:800; text-align:left; }
  button.opt[data-active="true"]{ outline:2px solid var(--accent); background:transparent; }
  .opt .codecell{ font-family: ui-monospace, SFMono-Regular, Menlo, Monaco, Consolas, "Liberation Mono", "Courier New", monospace; background:transparent; border:1px solid var(--border); padding:2px 6px; border-radius:6px; margin-right:6px; }

const state = {"F": "F", "X1": "A", "X2": "0", "X3": "A", "X4": "0", "X5": "2", "X6": "1", "X7": "K", "X8": "A", "X9": "C", "X10": "Z", "X11": "1"};

function assembleCode(){
  const order = ["F","X1","X2","X3","X4","X5","X6","X7","X8","X9","X10","X11"];
  const code = order.map(k => state[k]||"").join("");
  document.getElementById("fullCode").textContent = code;

  const cont = document.getElementById("positions");
  cont.innerHTML = "";
  order.forEach((k) => {
    const chip = document.createElement("div");
    chip.className = "chip";
    const small = document.createElement("small");
    small.textContent = k;
    const strong = document.createElement("strong");
    strong.textContent = state[k] || "";
    chip.appendChild(small);
    chip.appendChild(strong);
    cont.appendChild(chip);
  });

  const priceEl = document.getElementById("price");
  const price = PRICE_MAP[code];
  priceEl.textContent = price ? (price + " Kč") : "Není v ceníku";
}

function setX(key, val){
  if(["F","X1","X9","X10","X11"].includes(key)) return;
  state[key] = String(val).toUpperCase();
  assembleCode();
  document.querySelectorAll('[data-x="'+key+'"]').forEach(btn => {
    if((btn.dataset.val||"").toUpperCase() === state[key]){
      btn.setAttribute("data-active","true");
    }else{
      btn.removeAttribute("data-active");
    }
  });
}

function createGroup(title, xLabel, options){
  const group = document.createElement("div");
  group.className = "group";
  const header = document.createElement("header");
  const h3 = document.createElement("h3");
  h3.textContent = `${title} (${xLabel})`;
  header.appendChild(h3);
  group.appendChild(header);
  const opts = document.createElement("div");
  opts.className = "opts";
  options.forEach(([code, desc]) => {
    const btn = document.createElement("button");
    btn.className = "opt";
    btn.dataset.x = xLabel;
    btn.dataset.val = String(code);
    btn.innerHTML = `<span class="codecell">${code}</span>${desc}`;
    btn.addEventListener("click", () => setX(xLabel, code));
    if(state[xLabel] && String(state[xLabel]).toUpperCase() === String(code).toUpperCase()){
      btn.setAttribute("data-active","true");
    }
    opts.appendChild(btn);
  });
  group.appendChild(opts);
  return group;
}

function init(){
  assembleCode();
  const groups = document.getElementById("groups");

  groups.appendChild(createGroup("Typ", "X2", [
    ["0", "FD1600 - Volně stojící s polymerovou komorou"],
    ["1", "FD1610 - Volně stojící s nerezovou komorou"],
    ["2", "FD1615 - Vestavěná s nerezovou komorou"]
  ]));

  groups.appendChild(createGroup("Jednotka", "X3", [
    ["A","230VAC; 1N+PE; 50Hz (L1)"],
    ["B","240VAC; 2N+PE; 60Hz (L5)"],
    ["C","208VAC;  2N+PE; 60Hz (L9)"],
    ["D","200VAC; 2N+PE; 50Hz (L14)"],
    ["E","200VAC; 2N+PE; 60Hz (L18)"],
    ["F","230VAC; 1N+PE; 60Hz (L22)"],
    ["G","240VAC; 1N+PE; 50Hz (L28)"]
  ]));

  groups.appendChild(createGroup("Hlavní vypínač", "X4", [
    ["0","Hlavní vypínač NE"],
    ["1","Hlavní vypínač ANO"]
  ]));

  groups.appendChild(createGroup("Dávkování", "X5", [
    ["1","Parní generátor"],
    ["2","Parní gener + detergent"],
    ["3","Parní gener + oplach nádrž"],
    ["4","Parní gener + oplach nádrž + deterg"]
  ]));

  groups.appendChild(createGroup("Chlazení", "X6", [
    ["1","Chladicí ventilátor s HEPA filtrem"],
    ["2","Vnitřní chlazení, voda z nádrže"],
    ["3","Žádná fáze chlazení"]
  ]));

  groups.appendChild(createGroup("Držáky", "X7", [
    ["0","Bez držáků"],
    ["A","Univerzální s rozšířeným otáčením. Rozšíření trysky 175mm"],
    ["B","Standard B"],
    ["K","Standard K"]
  ]));

  groups.appendChild(createGroup("Materiál", "X8", [
    ["A","Polymer (včetně vrchu)"],
    ["B","Polymer pro vnější plášť a nerezovou ochrana"],
    ["C","Z nerezové oceli pro vnější stranu, vrch polymer"],
    ["D","Z nerezové oceli pro vnější stranu, plášť s ochranou z nerezové oceli"],
    ["E","Z nerezu vnější strana, plášť s vrchem z nerezu"]
  ]));

  // Theme toggle
  const toggle = document.getElementById("themeToggle");
  toggle.addEventListener("click", () => {
    const root = document.documentElement;
    root.setAttribute("data-theme", root.getAttribute("data-theme")==="light" ? "dark" : "light");
  });

  // Copy button
  const copyBtn = document.getElementById("copyBtn");
  copyBtn.addEventListener("click", async () => {
    const order = ["F","X1","X2","X3","X4","X5","X6","X7","X8","X9","X10","X11"];
    const code = order.map(k => state[k]||"").join("");
    const price = PRICE_MAP[code] || "Není v ceníku";
    const text = `${code}\t${price}`;
    try {
      await navigator.clipboard.writeText(text);
      const old = copyBtn.textContent;
      copyBtn.textContent = "Zkopírováno ✓";
      setTimeout(()=>copyBtn.textContent=old, 1200);
    } catch(e) {
      const ta = document.createElement("textarea");
      ta.value = text;
      document.body.appendChild(ta);
      ta.select();
      document.execCommand("copy");
      document.body.removeChild(ta);
      const old = copyBtn.textContent;
      copyBtn.textContent = "Zkopírováno ✓";
      setTimeout(()=>copyBtn.textContent=old, 1200);
    }
  });
}

document.addEventListener("DOMContentLoaded", init);
</script>
